import './App.css';
import Search from './componets/search/Search';
import Navbar from './componets/navbar/Navbar'
import ProfileCard from './componets/home/profile/ProfileCard';

function App() {
  return (
    <div className="container">
      <div className='nav'>
        <Navbar />
      </div>
      <div className='search'>
         <Search />
      </div>
      <div className='home'>
         <ProfileCard/>
      </div>
      <div className='footer'>
         <Footer />
      </div>

    </div>
  );
}

export default App;
